import React from 'react'
import ReactDOM from 'react-dom';
import Sdata from './Sdata.jsx'
import Card from './Card.jsx'

const Netflix = () => {
  {Sdata.map((val,index) => {
    return (
        <Card
          key={val.id}
          imgsrc={val.imgscr}
          title={val.title}
          sname={val.sname}
          link={val.link}
        />
        )
      })};
}
export default Netflix;
